script: |
  super -f text -I q12229.spq | sort > q12229.out

inputs:
  - name: q12229.spq
    data: |
      SELECT - col0 + - - CAST ( 60 AS INTEGER ) AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE ( NULL BETWEEN col1 * + col0 AND + 37 - col0 * + 35 + - + col1 );
  - name: tab1

outputs:
  - name: q12229.out
    data: |
